import React  , {Component}from 'react';


class Product extends Component {
    state = { 
        name : "Burger",
        number : 5
     } 
    render() { 
        return (
            <>
            <div>
                <span>{this.state.name}</span>
                <span className='primary bg-primary m-3 p-3'>{this.state.number}</span>
            </div>
            </>
        );
    }
}
 
export default Product;
